import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
  Tooltip,
  Label,
  AreaChart,
  Area,
  PieChart,
  Pie,
} from "recharts";

const PieChartDiagram = () => {
  return (
    <ResponsiveContainer width="100%" aspect={2}>
      <PieChart width={730} height={250}>
        <Pie
          data={Data}
          dataKey="value"
          nameKey="name"
          cx="50%"
          cy="50%"
          outerRadius={50}
          fill="#8884d8"
        />
      </PieChart>
    </ResponsiveContainer>
  );
};

export default PieChartDiagram;
